import React, { useState, Fragment } from 'react';
import Header from "../../components/Helpers/Header/Header";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import TimeTable from "../../components/TimeTable/TimeTable";
import Announcements from "../../components/Announcements/Announcements";
import Profile from "./Profile";
import AdminSection from "../AdminSection/AdminSection";
import AddStudentSection from "../AdminSection/AddStudentSection/AddStudentSection";
import AddStudentMarksSection from "../AdminSection/AddStudentMarksSection/AddStudentMarksSection";
import DashboardDrawer from "../../components/DashboardDrawer/DashboardDrawer";

const Dashboard = props => {
  return (
    <Fragment>
      <Header />
      <DashboardDrawer />
      <BrowserRouter>
        <Switch>
          <Route path={"/dashboard"} render={props => <AdminSection { ...props } />} exact />
          <Route path={"/dashboard/profile"} render={ props => <Profile { ...props } /> } />
          <Route path={"/dashboard/announcements"} render={ props => <Announcements { ...props } /> } />
          <Route path={"/dashboard/student/:action"} render={props => <AddStudentSection { ...props } />} exact />
          <Route path={"/dashboard/studentMarks/:action"} render={props => <AddStudentMarksSection { ...props } />} exact />
        </Switch>
      </BrowserRouter>
    </Fragment>
  )
};

export default Dashboard;
